import React from 'react'
//Locales
import { useLocales } from "../../../locales";
// mui
import { Box, Typography } from "@mui/material";
// pdf reader
import { Viewer } from "@react-pdf-viewer/core";
import { Worker } from "@react-pdf-viewer/core";
import '@react-pdf-viewer/core/lib/styles/index.css';
//url
import * as URLS from "../../../urls";
// -------------------------------------------------------------------------

// ----------- Styles -------------
const BoxStyle = {
    display: "flex",
    flexDirection: "column",
    border: "",
    paddingLeft: "32px",
    paddingRight: "32px",
    paddingTop: "34px",
    paddingBottom: "53px",
    boxShadow: " 2px 2px 10px rgba(0, 0, 0, 0.1)",
    borderRadius: "5px",
    background: "#FFFFFF",

}

const typoStyle = {
    fontSize: "20px",
    fontWeight: "600",
    lineHeight: "16px",
    color: "#010F07",
    paddingBottom: "32px"
}

const contentStyle = {
    fontSize: "16px",
    fontWeight: "300",
    lineHeight: "27px",
    color: "#535353",
}

export default function LegalUpdates() {

    const { translate } = useLocales();

    // ---------- JSX Code ---------
    return (
        <Box sx={{ ...BoxStyle, mt: '6px' }}>
            <Typography sx={{ ...typoStyle }}>
                {translate("legal_updates")}
            </Typography>
            {/* <Typography sx={{ ...contentStyle, fontWeight: 600, fontSize: '18px' }}>
        {translate("acceptance_of_terms")}
      </Typography>
      <Typography paddingBottom={"50px"} sx={{ ...contentStyle }}>
        {translate("p1")}
      </Typography>
      <Typography sx={{ ...contentStyle }}>
        {translate("p2")}
      </Typography>
      <Typography sx={{ ...contentStyle }}>
        {translate("p3")}
      </Typography>
      <Typography sx={{ ...contentStyle }}>
        {translate("p4")}
      </Typography>
      <Typography sx={{ ...contentStyle }}>
        {translate("h1")}
      </Typography>
      <Typography sx={{ ...contentStyle }}>
        {translate("h2")}
      </Typography>
      <Typography sx={{ ...contentStyle }}>
        {translate("h3")}
      </Typography>
      <Typography sx={{ ...contentStyle }}>
        {translate("p5")}
      </Typography> */}

            <Worker workerUrl="https://unpkg.com/pdfjs-dist@3.4.120/build/pdf.worker.min.js">
                <Viewer fileUrl={URLS.adminLegalURL} />
            </Worker>
        </Box>
    )
}
